document.addEventListener('DOMContentLoaded', () => {
    // Türkiye'nin merkez koordinatları
    const turkeyCenter = [39.0, 35.0];
    
    // Haritayı başlat
    map = L.map('map', {
        center: turkeyCenter,
        zoom: 6,
        minZoom: 3,
        maxZoom: 18
    });

    // Başlangıç temasını kontrol et
    const savedTheme = localStorage.getItem('theme') || 'light';
